import React from "react";
import { Bar } from "react-chartjs-2"

const Chart = () => {

    return (
        <div>
            <h4>Chart</h4>
            <Bar
                data={{
                    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
                    datasets: [
                        {
                            label: 'colores',
                            data: [12, 19, 3, 5, 2, 3]
                        },
                    ]
                }}
                height={200}
                width={300}
                options={{
                    maintainAspectRatio: false,
                }}
            />
        </div >
    )
}

export { Chart }
